import React, {Fragment} from 'react';
import './App.css';
import Navbar from './Layout/Navbar';
import Home from './Layout/Home';
import Footer from './Layout/Footer';
import about_us from './Layout/AboutUs';
// import DonorRegister from './components/DonorRegister';
// import SeekerRegister from './components/SeekerRegister';
import Form from './components/Form';
import SeekerReg from './Layout/SeekerReg';
import DonorReg from './Layout/DonorReg';
import FAQ from './Layout/FAQ';
import Login from './Layout/Login'; 
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';

function App() {
  return (
    <Router> 
    <Fragment>
      <Navbar />
      <Route exact path='/' component={Home} />
        <Switch>
        <Route exact path='/about_us' component={about_us} /> 
        {/* <Route exact path='/DonorRegister' component={DonorRegister} />
        <Route exact path='/SeekerRegister' component={SeekerRegister} /> */}
        <Route exact path='/Form' component={Form} />
        <Route exact path='/seeker_registration' component={SeekerReg} />
        <Route exact path='/donor_registration' component={DonorReg} />
        <Route exact path='/faq' component={FAQ} />
        <Route exact path='/login' component={Login} />
        </Switch>
      <Footer />
    </Fragment>
    </Router>
  );
}

export default App;
